import React from "react";
import ReactDOM from "react-dom";
import "./style.css";

const Hello = () => {
    return (
        <div>
            <h1 style={{ textAlign: "center", color: 'orange'}}>Hello World!</h1>
            <button className="button">About Me</button>
            <button className="button">My Linkedin</button>
            <button className="button">My Github</button>
        </div>

    )
}

ReactDOM.render(<Hello />, document.getElementById('root'))
